import axios from "axios";
import React, { useState } from "react";
import { useParams } from "react-router-dom";

const Oyuncular =() =>{

    let {id} = useParams();
    const [oyuncular, setOyuncular]=useState([])

    const api_link=`https://cryptic-gorge-72989.herokuapp.com/players`
    axios.get(api_link)
    .then(oyuncular=>{
        setOyuncular(oyuncular.data)
    })


    return(
        <div>
            {oyuncular.name}
        </div>
    )
}

export default Oyuncular;
